INSERT INTO `tb_kandidat` (`id`, `no_urut`, `nama_ketua`, `nama_wakil`, `visi`, `misi`, `foto`) VALUES
(1, 1, 'Irfan Walhidayah', 'Putu Zasya Eka Satya Nugraha', 'Mewujudkan Himpunan Mahasiswa Jurusan Teknik Informatika Yang <b>“PATEN”</b> (Profesional, Aktif, Transparansi, Empati,Nasionalis) Serta Berkualitas, Berkarakter dan Unggul Baik di Bidang Akademik Maupun Non Akademik.', '<ol>\r\n<li>Menjadikan HMJ Teknik Informatika Sebagai Wadah Untuk Menampung Aspirasi Bagi Seluruh Mahasiswa Teknik Informatika.</li>\r\n<li>Bersinergi Serta Mengayomi Seluruh Mahasiswa Teknik Informatika.</li>\r\n<li>Menyelenggarakan Program Kerja Yang Menarik dan Bermanfaat Bagi Seluruh Mahasiswa Teknik Informatika dengan Tetap Berpegang Teguh Pada Falsafah Tri Hita Karana.</li>\r\n<li>Memfasilitasi Serta Mengapresiasi Mahasiswa Teknik Informatika Untuk Meningkatkan Serta Mengembangkan Minat dan Bakat. Guna Mewujudkan Mahasiswa Teknik Informatika Yang Berprestasi Baik Bidang Akademik Maupun Non Akademik.</li>\r\n<li>Memegang Teguh Nilai Kebersamaan dan Kekeluargaan Tanpa Terjadi Perselisihan Baik di Lingkungan Internal Maupun Eksternal.</li>\r\n</ol>', '2020_1.png'),
(2, 2, 'Putu Adi Indrawan', 'Kadek Rama Sanjaya', 'Menjadikan Himpunan Jurusan TI yang Unggul,Responsif, dan menjunjung tinggi Solidaritas', '<ol>\r\n<li>Mewadahi dan menfasilitasi minat dan bakat mahasiswa/i yang berada dilingkungan Jurusan TI</li>\r\n<li>Meningkatkan partisipasi mahasiswa jurusan TI di bidang akademik dan non akademik</li>\r\n<li>Menjalin hubungan internal dan external HMJ TI Yang memiliki rasa solidaritas berdasarkan integritas </li>\r\n</ol>', '2020_2.png'),
(3, 3, 'Gede Budi Setiawan', 'Gede Beny Indrawan', 'Mewujudkan HMJ Teknik Informatika sebagai wadah untuk menampung aspirasi, kreativitas, dan minat bakat mahasiswa Jurusan Teknik Informatika dalam rangka menciptakan mahasiswa Teknik Informatika yang unggul dan berkarakter', '<ol>\r\n<li>Mewadahi potensi yang dimiliki oleh mahasiswa Jurusan Teknik Informatika baik di bidang akademik maupun non akademik</li>\r\n<li>Meningkatkan rasa kekeluargaan antara mahasiswa, dosen dan pegawai di lingkungan Jurusan Teknik Informatika</li>\r\n<li>Mengembangkan kemampuan softskill mahasiswa Teknik Informatika sehingga menjadi mahasiswa yang unggul dan berkarakter.</li>\r\n</ol>', '2020_3.png');
